$(document).ready(function () {
  $("#button").click(function () {
    var doc = new jsPDF();
    var imgData =
      "data:image/jpeg;base64,";

    doc.addImage(imgData, "JPEG", 0, 0, 210, 297);

    var name = $("#name").val();
    var dob = $("#dob").val();
    var doa = $("#doa").val();
    var dol = $("#dol").val();
    var col = $("#col").val();
    var promotion = $("#promotion").val();
    var duefee = $("#duefee").val();
    var lue = $("#lue").val();
    var rad = $("#rad").val();
    var pen = $("#pen").val();
    var dop = $("#dop").val();
    var dof = $("#dof").val();
    var date = $("#date").val();

    doc.setFontSize(11);
    doc.setTextColor(0, 0, 0);

    doc.text(166, 87, date);
    doc.text(96, 101.5, name);
    doc.text(96, 115, dob);
    doc.text(96, 128.5, doa);
    doc.text(96, 142, dol);
    doc.text(96, 155, col);
    doc.text(96, 168.5, promotion);
    doc.text(96, 182, duefee);
    doc.text(96, 195, lue);
    doc.text(96, 214, rad);
    doc.text(96, 228, pen);
    doc.text(98, 250, dop);
    doc.text(98, 264, dof);

    //for opening preview
    var string = doc.output("datauristring");
    var embed = "<embed width='100%' height='100%' src='" + string + "'/>";
    var x = window.open();
    x.document.open();
    x.document.write(embed);
    x.document.close();
  });
});
